---@enum HumanoidStateType
---`FallingDown`: The Humanoid has been tripped, and will attempt to get up in a few
---moments.
---
---`Running`: Currently running while physics of parts in range are being calculated
---(e.g. After a jump, close to other players, and others).
---
---`RunningNoPhysics`: Currently running and not near other physical objects. (deprecated).
---
---`Climbing`: The Humanoid is climbing (e.g. up a `Class.TrussPart` or ladder).
---
---`StrafingNoPhysics`: Not currently used with default Humanoid. Cannot be set with
---`Class.Humanoid:ChangeState()`.
---
---`Ragdoll`: The Humanoid has been hit by a fast moving object (uncontrolled falling).
---_The Humanoid can recover from this._
---
---`GettingUp`: The Humanoid is getting back on their feet after Ragdoll.
---
---`Jumping`: The Humanoid just jumped. (Check `Class.Humanoid.Jump`). This state lasts
---only briefly. This state normally transitions into either Standing, if on
---the ground, or Freefall, if still in the air.
---
---`Landed`: The Humanoid touched the ground after a Freefall. This state lasts only
---briefly.
---
---`Flying`: When set, the Humanoid won't be animated, as with the
---`Class.Humanoid.PlatformStand` property. This state lasts as long as the
---player flies.
---
---`Freefall`: The Humanoid is currently freefalling (jumped from a height).
---
---`Seated`: The Humanoid is currently sitting in a Seat or VehicleSeat. Check the
---`Class.Humanoid.Sit` property.
---
---`PlatformStanding`: The Humanoid is platformstanding. Check the `Class.Humanoid.PlatformStand`
---property.
---
---`Dead`: The Humanoid died. Changing a Humanoid's state to this one will kill it.
---
---`Swimming`: The Humanoid is currently swimming in `Class.Terrain` water.
---
---`Physics`: The Humanoid doesn't apply any force on its own and will not automatically
---transition to any other state. This state has to be set and unset manually
---using `Class.Humanoid:ChangeState()`.
---
---`None`: Unusable placeholder in case an unknown state gets triggered internally.
---[enums/HumanoidStateType](https://create.roblox.com/docs/reference/engine/enums/HumanoidStateType)
