---@enum WrapLayerDebugMode
---`None`: This debug rendering mode does nothing. This is the default value.
---
---`BoundCage`: This debug mode visualizes corresponding cage mesh vertices bound to an
---underlying `Class.WrapTarget`. In order to find corresponding vertices
---between different cages, the Wrap Deformer algorithm uses UV matching. As
---long as your `Class.WrapLayer` cage mesh share the same UV layout as
---`Class.WrapTarget`, its vertices will be marked as "bound".
---
---`LayerCage`: This debug mode shows the resulting layer mesh as a whole. The deformer
---will use vertex locations from the previous layer for all unbound
---vertices.
---
---`BoundCageAndLinks`: The same as BoundCage but also visualizes how bound vertices were moved.
---You can use this mode to identify where they belong on a previous layer
---and where they are located on the current layer.
---
---`Reference`: This debug mode shows the original inner cage mesh as it was created.
---
---`Rbf`: This debug mode visualizes the internal RBF solver state. You can estimate
---the wrap deformer's expected behavior by looking at this state. All
---renderable mesh vertices move from a "big sphere" to a "small sphere"
---along a corresponding line connecting two spheres.
---
---`OuterCage`: This debug mode shows the original outer cage mesh as it was created.
---
---[enums/WrapLayerDebugMode](https://create.roblox.com/docs/reference/engine/enums/WrapLayerDebugMode)
WrapLayerDebugMode={None=0,BoundCage=1,LayerCage=2,BoundCageAndLinks=3,Reference=4,Rbf=5,OuterCage=6,ReferenceMeshAfterMorph=7,HSROuterDetail=8,HSROuter=9,HSRInner=10,HSRInnerReverse=11,LayerCageFittedToBase=12,LayerCageFittedToPrev=13},
---@enum WrapTargetDebugMode
---`None`: This debug rendering mode does nothing, and this is the default value.
---
---`TargetCageOriginal`: This debug mode shows the original cage mesh as it was created.
---
---`TargetCageCompressed`: This debug mode shows corresponding cage mesh compressed by clothing
---layers above it. This debug mode is intended to validate that the
---compression algorithm and corresponding cages work as intended.
---
---`TargetCageInterface`: This debug mode shows the resulting cage mesh for the corresponding Wrap
---Instance. This debug mode is intended to validate that the final deformed
---cage looks as intended.
---
---`TargetLayerCageOriginal`: The same as TargetCageOriginal but affects all WrapTargets that belong to
---the Wrap Deformer simultaneously. It doesn't matter which particular
---WrapTarget you enable this debug visualization option.
---
---`TargetLayerCageCompressed`: The same as TargetCageCompressed but affects all WrapTargets that belong
---to the Wrap Deformer simultaneously. It doesn't matter which particular
---WrapTarget you enable this debug visualization option.
---
---`TargetLayerInterface`: The same as TargetCageInterface but affects all WrapTargets that belong to
---the Wrap Deformer simultaneously. It doesn't matter which particular
---WrapTarget you enable this debug visualization option.
---
---`Rbf`: This debug mode visualizes the internal RBF solver state. You can estimate
---the wrap deformer expected behavior by looking at this state. All
---renderable mesh vertices move from a "big sphere" to a "small sphere"
---along a corresponding line connecting two spheres.
---
---[enums/WrapTargetDebugMode](https://create.roblox.com/docs/reference/engine/enums/WrapTargetDebugMode)
WrapTargetDebugMode={None=0,TargetCageOriginal=1,TargetCageCompressed=2,TargetCageInterface=3,TargetLayerCageOriginal=4,TargetLayerCageCompressed=5,TargetLayerInterface=6,Rbf=7,OuterCageDetail=8},
